var debug=!1;function hashcode(){var c=document.getElementById("devices").options[document.getElementById("devices").selectedIndex].text;if("All"==c)document.getElementById("device_id").value=0,convertToHash();else{for(var b=0,a=0;a<c.length;a++)b=(b<<5)-b+c.charCodeAt(a),b&=b;document.getElementById("device_id").value=b}}
function convertToHash(){for(var c=1;c<document.getElementById("devices").options.length;c++){for(var b=document.getElementById("devices").options[c].text,a=0,d=0;d<b.length;d++)a=(a<<5)-a+b.charCodeAt(d),a&=a;document.getElementById("all").value+=a+","}};
